import React from "react";
import './App.css';


function App() {
    return (
        <div>
            <Header/>
            <Technologies/>
        </div>
    );
}


function Technologies() {
    return (
        <div>
            <ul>
                <li>css</li>
                <li>html</li>
                <li>js</li>
                <li>react</li>
            </ul>
        </div>
    );
}

export default App;
